from bs4 import BeautifulSoup, Comment

def filter_html(html_content):
    """
    Takes an HTML string and returns a 'filtered' version
    that removes most non-visible or irrelevant HTML elements,
    keeping only a predefined list of allowed tags.
    """
    
    soup = BeautifulSoup(html_content, 'html.parser')
    
    # 1. Remove tags that are typically not part of main content
    for tag in soup(['script', 'style', 'meta', 'link', 'noscript']):
        tag.decompose()
    
    # 2. Remove HTML comments (optional)
    for comment in soup.find_all(text=lambda text: isinstance(text, Comment)):
        comment.extract()
    
    # 3. Choose which tags to keep (customize as needed!)
    allowed_tags = [
        'html', 'body', 'main', 'div', 'span', 'p', 'h1', 'h2', 'h3', 'h4', 'h5', 'h6',
        'a', 'input', 'button', 'ul', 'li', 'section', 'article'
    ]
    
    # 4. Decompose (remove) any tags not in the allowed list
    for tag in soup.find_all():
        if tag.name not in allowed_tags:
            tag.decompose()
    
    # 5. (Optional) Remove attributes from the remaining tags if you want to "compress" more
    for tag in soup.find_all():
        tag.attrs = {}
    
    return str(soup)

